import React from 'react';


class DrRegister extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            username: '',
            password: '',
            repassword: '',
            firstName: '',
            lastName: '',
            npi: '',
            address: '',
            city: '',
            us_state: '',
            zip: ''
        }

    }


    handleUsernameChange = (event) =>
    {
        this.setState(
            {
                username: event.target.value
            })
    }

    handlePasswordChange = (event) =>
    {
        this.setState(
            {
                password: event.target.value
            })
    }

    handleRePasswordChange = (event) =>
    {
        this.setState(
            {
                repassword: event.target.value
            })
    }

    handleFirstNameChange = (event) =>
    {
        this.setState(
            {
                firstName: event.target.value
            })
    }

    handleLastNameChange = (event) =>
    {
        this.setState(
            {
                lastName: event.target.value
            })
    }

    handleNpiChange = (event) =>
    {
        this.setState(
            {
                npi: event.target.value
            })
    }

    handleAddressChange = (event) =>
    {
        this.setState(
            {
                address: event.target.value
            })
    }

    handleCityChange = (event) =>
    {
        this.setState(
            {
                city: event.target.value
            })
    }

    handleUs_StateChange = (event) =>
    {
        this.setState(
            {
                us_state: event.target.value
            }
        )
    }

    handleZipChange = (event) =>
    {
        this.setState(
            {
                zip: event.target.value
            }
        )
    }
    handleSubmit = (event) =>
    {

        alert(`Test Variables
               --------------
               Username: ${this.state.username} 
               Password: ${this.state.password}
             Repassword: ${this.state.repassword}
              FirstName: ${this.state.firstName}
               LastName: ${this.state.lastName}
                    NPI: ${this.state.npi}
                Address: ${this.state.address}
                   City: ${this.state.city}
               US_State: ${this.state.us_state}
                    Zip: ${this.state.zip}`
             );


        event.preventDefault();


    }
    render() {
        return (
            <form action={"Lenny.js"} onSubmit = {this.handleSubmit} method={"POST"}>
                <label>
                    <u>Registration for Physicians</u>
                    <br />
                </label>
                <br />
                <label>
                    Username:
                    <input
                        name="username"
                        type="text"
                        value={this.state.username}
                        onChange={this.handleUsernameChange}
                        required/>
                </label>



                <br />
                <label>
                    Password:
                    <input
                        name="password"
                        type="text"
                        value={this.state.password}
                        onChange={this.handlePasswordChange}
                        required/>
                </label>

                <br />
                <label>
                    Repeat Password:
                    <input
                        name="repassword"
                        type="text"
                        value={this.state.repassword}
                        onChange={this.handleRePasswordChange}
                        required/>
                </label>

                <br />
                <label>
                    First Name:
                    <input
                        name="firstName"
                        type="text"
                        value={this.state.firstName}
                        onChange={this.handleFirstNameChange}
                        required/>
                </label>

                <br />

                <label>
                    Last Name:
                    <input
                        name="lastName"
                        type="text"
                        value={this.state.lastName}
                        onChange={this.handleLastNameChange}
                        required/>
                </label>

                <br />

                <label>
                    NPI:
                    <input
                        name="npi"
                        type="text"
                        value={this.state.npi}
                        onChange={this.handleNpiChange}
                        required/>
                </label>

                <br />
                <u>Clinic's Address:</u>
                <br />
                <label>
                    Street:
                    <input
                        name="address"
                        type="text"
                        value={this.state.address}
                        onChange={this.handleAddressChange}
                        required/>
                </label>

                <br />
                <label>
                    City:
                    <input
                        name="city"
                        type="text"
                        value={this.state.city}
                        onChange={this.handleCityChange}
                        required/>
                </label>

                <label>
                    State:
                    <select value={this.state.us_state} onChange={this.handleStateChange}>
                        
                    </select>

                </label>

                <label>
                    Zip Code:
                    <input
                        name="zip"
                        type="numbers"
                        value={this.state.zip}
                        onChange={this.handleZipChange}
                        required/>
                </label>

                <br />
                <label>
                    Upload Profile Picture:
                    <br />
                    <input type="file" />
                </label>
                <br />
                <br />
                <button type="submit">Register</button>
            </form>
        );
    }
};

export default DrRegister;
